import React from 'react';
import './Card.css';
import { deletePokemon } from '../actions';




export default function Card({ name, image, types, created}){

function handleDelete(e){
    dispatch(deletePokemon(e.target.value))   //el value será el tipo seleccionado en las opciones del filtro
}
    return (
        <div className='card' >
            {created && <button type='button'>X</button>}
            <h3>{name}</h3>
            <h5>{types}</h5>
            <img className='poke-img' src={image} alt='img not found' />
        </div>

    );
}
